import React from "react";
import classes from "./Menu.module.css";
const Menu = () => {
	return (
		<div className="row">
			<div className="col-lg-12">
				<div className={classes.menu}>
					<ul>
						<span className={classes.menu_span}>
							<li>Eventos</li>
							<li>Galeria </li>
							<li>Contactos</li>
							<li>Qui√©nes somos ?</li>
						</span>
					</ul>
				</div>
			</div>
		</div>
	);
};

export default Menu;
